import React from "react";

export default function Card(props) {
  // console.log('hey probando')
  // ac치 va tu c칩digo

  console.log(props);
  return (
    // <> es igual a <react.Fragment></react.Fragment>
    <>
      <h1>Nombre de la ciudad</h1>
      <h3>Min</h3>
      <h4>Valor de la temp minima</h4>
      <h3>Max</h3>
      <h4>Valor de la temp maxima</h4>

      <img src="" alt=""/>
      <button>X</button>
      <div>
        Temperatura Maxima: {props.max}
        <br />
        Temperatura Minima: {props.min}
        <br />
        Nombre: {props.name}
      </div>
    </>
  );
}
